import React from 'react'

const About = () => {
  return (
    <PageBanner
   heading="Contact Us"
   breadcrumbLinks={[
     { label: 'Home', href: '/' },
     { label: 'Contact', href: '/contact' }
   ]}
 />
  )
};

export default About;
